9: ResultsThe pooled results showed that mortality in cancer patients was higher in the pandemic period than in the pre-pandemic period (RR 1.30; 95% CI 1.101.54; p=0.002), and patients with lung cancer had the highest risk of death (RR 1.48; 95% CI 1.161.88; p=0.001). There were no significant differences in the rate of ICU admission (RR 1.01; 95% CI 0.951.06; p=0.839) or mechanical ventilation (RR 0.99; 95% CI 0.911.07; p=0.761) between the two periods. In the pandemic period, fewer patients received IAT (RR 0.90; 95% CI 0.860.95; p<0.001) and fewer were diagnosed with cancer (RR 0.90; 95% CI 0.870.94; p<0.001).

10: ConclusionThe COVID-19 pandemic has led to worse outcomes in patients with cancer.

